window.bookSummaryJSON = "<p><b>From </b><b><i>New York Times</i></b><b> best-selling author Pepper Winters comes a spin-off novella featuring Sully and Jinx from the </b><b><i>USA Today </i></b><b>best-selling series Goddess Isles.</b></p> <p>“A marriage born from slavery and secrets. A happily ever after like no other.”</p> <p>Sullivan Sinclair has a wife who shares his wildness and desires. To others, she is regal and perfect on his arm. To him, she is a goddess with dirty appetites that need to be fulfilled.</p> <p>Eleanor Sinclair has a husband who allows her darkest fantasies to come true. Aboard their new luxury yacht, purchased for their cluster of islands called Rapture, he suggests a game of seduction. Another play in Euphoria.</p> <p>Sea, sky, or sand - thanks to Sully’s unique playground, they can play anywhere. They can change their appearances, distort time, and indulge in romance with no rules.</p> <p>Eleanor granted Sully’s ultimate fantasy.</p> <p>Now, it’s Sully’s turn to grant hers.</p>"; 
